end if;
nuIndex :=  CNCRM_.tbRoleExecutables.first;
while nuIndex IS NOT null loop
 if (CNCRM_.tbRoleExecutables(nuIndex).role_id!=1) then
  nuNewExecutableId := fnuGetNewExecutableId(CNCRM_.tbRoleExecutables(nuIndex).name);
  IF nuNewExecutableId is not null then
    INSERT INTO sa_role_executables (role_id, executable_id)
    VALUES (CNCRM_.tbRoleExecutables(nuIndex).role_id, nuNewExecutableId);
  END IF;
  end if;
 nuIndex := CNCRM_.tbRoleExecutables.next(nuIndex);
END loop;
nuIndex :=  CNCRM_.tbUserException.first;
while nuIndex IS NOT null loop
 nuNewExecutableId := fnuGetNewExecutableId(CNCRM_.tbUserException(nuIndex).name);
 IF nuNewExecutableId is not null then
  insert INTO sa_user_exceptions (executable_id, user_id, status, usr_exc_type_id, comment_)
  VALUES (nuNewExecutableId ,CNCRM_.tbUserException(nuIndex).user_id, CNCRM_.tbUserException(nuIndex).status , CNCRM_.tbUserException(nuIndex).usr_exc_type_id, CNCRM_.tbUserException(nuIndex).comment_);
 END IF;
 nuIndex := CNCRM_.tbUserException.next(nuIndex);
END loop;
nuIndex :=  CNCRM_.tbExecEntities.first;
while nuIndex IS NOT null loop
 nuNewExecutableId := fnuGetNewExecutableId(CNCRM_.tbExecEntities(nuIndex).name);
 IF nuNewExecutableId is not null then
  select count(1) into nuRecCount
 from sa_exec_entities
  where executable_id = nuNewExecutableId and entity_id = CNCRM_.tbExecEntities(nuIndex).entity_id;
  IF nuRecCount = 0 then
    insert INTO sa_exec_entities (executable_id, entity_id )
    VALUES (nuNewExecutableId ,CNCRM_.tbExecEntities(nuIndex).entity_id );
  END IF;
 END IF;
 nuIndex := CNCRM_.tbExecEntities.next(nuIndex);
END loop;

exception when others then
CNCRM_.blProcessStatus := false;
rollback;
ut_trace.trace('**ERROR:'||sqlerrm);
raise;
